import React from "react";

function Card(props) {
    console.log(props);
    return (
        <>
            <div className="cards">
                <div></div>
                <img src={props.images} alt="Images" />
                <span>{props.title}</span>
                <div>{props.type}</div>
            </div>
        </>
    )
};

export default Card;
